import React, { useContext, useEffect, useState } from "react";
import { West, ArrowForwardIos, FavoriteBorder } from "@mui/icons-material";
import {
  FormControl,
  InputLabel,
  MenuItem,
  Select,
  Slider,
} from "@mui/material";
import { Cancel, StarOutlined } from "@mui/icons-material";
import { Modal } from "antd";
import ProductCard from "../../componentsFood/ProductCard";
import { useHistory } from "react-router-dom";

import { Context } from "../../context/context";
import tm from "../../lang/tm/home.json";
import en from "../../lang/en/home.json";
import ru from "../../lang/ru/home.json";
import { axiosInstance } from "../../utils/axiosIntance";
import { useParams } from "react-router-dom";

const SearchProducts = () => {
  const history = useHistory();
  const { dil } = useContext(Context);
  const { product_name } = useParams();
  const [sort, setSort] = useState("ASC");
  const [starOpen, setStarOpen] = useState(false);
  const [liked, setLiked] = useState(false);
  const [priceRange, setPriceRange] = useState([0, 1000]);
  const [naharlar, setNaharlar] = useState([]);
  const [categories, setCategories] = useState([]);

  useEffect(() => {
    getCategories();
    getDiscounts();
  }, [dil, sort]);

  const getCategories = () => {
    axiosInstance
      .get("/api/food_categories", {
        params: {
          page: 0,
          limit: 9999,
          lang: dil,
          order: "ASC",
        },
      })
      .then((data) => {
        console.log(data.data.body);
        setCategories(data.data.body);
      })
      .catch((err) => {
        console.log(err);
      });
  };
  const getDiscounts = () => {
    axiosInstance
      .get("/api/food_search_meal", {
        params: {
          page: 0,
          limit: 9999,
          lang: dil,
          order: sort,
          product_name: product_name,
        },
      })
      .then((data) => {
        console.log(data.data);
        setNaharlar(data.data.body);
      })
      .catch((err) => {
        console.log(err);
      });
  };

  return (
    <div className="w-full inline-flex justify-between pb-10 select-none">
      <div className="min-w-[245px] md2:block hidden w-[245px]">
        <button
          onClick={() => history.goBack()}
          className="w-full h-[50px]  bg-green-100 text-green text-[18px] font-semi rounded-[8px]"
        >
          <West />{" "}
          {dil === "TM"
            ? tm["Ähli restoranlar"]
            : dil === "RU"
            ? ru["Ähli restoranlar"]
            : en["Ähli restoranlar"]}
        </button>
        <div className="w-full px-4 mt-4 rounded-[8px] border-[1px] border-neutral-300">
          <h1 className="py-3 text-[20px] text-neutral-900 font-semi text-left">
            {dil === "TM"
              ? tm["Nahar kategoriýalary"]
              : dil === "RU"
              ? ru["Nahar kategoriýalary"]
              : en["Nahar kategoriýalary"]}
          </h1>
          {categories?.map((item) => {
            return (
              <p
                onClick={() => {
                  history.push({ pathname: "/rtn/category/" + item?.id });
                }}
                className="py-3 text-[16px] text-neutral-900 font-[300] text-left border-t-[1px] border-t-neutral-300 cursor-pointer"
              >
                {item?.name}
              </p>
            );
          })}
        </div>

        {/* <div className="w-full px-4 mt-4 rounded-[8px] border-[1px] border-neutral-300">
          <h1 className="py-3 text-[20px] border-b-[1px] border-b-neutral-300 text-neutral-900 font-semi text-left">
            {dil === "TM"
              ? tm.Restoranlar
              : dil === "RU"
              ? ru.Restoranlar
              : en.Restoranlar}
          </h1>
          <input
            onKeyUp={(e) => SearchMarkets(e.target.value)}
            className="w-full h-[50px] mt-2 outline-none p-4 rounded-[8px] border-[1px] border-neutral-300"
            type="text"
            placeholder="Search"
          />
          <div
            style={{ scrollbarColor: "#32BB78" }}
            className="max-h-[250px] overflow-auto"
          >
            {filterMarkets.map((item, index) => {
              return (
                <div
                  key={index}
                  className={
                    "flex items-center py-3 text-left   border-t-[1px] border-t-neutral-300"
                  }
                >
                  <input
                    className="mr-3 bg-neutral-300 text-neutral-300 border-neutral-300 w-[16px] h-[16px] "
                    type="checkbox"
                    id="brend1"
                  />
                  <label
                    htmlFor="brend1"
                    className="text-[16px] cursor-pointer text-neutral-900 font-[300] "
                  >
                    {item.name}
                  </label>
                </div>
              );
            })}
          </div>
        </div> */}

        <div className="w-full px-4 mt-4 rounded-[8px] border-[1px] border-neutral-300">
          <h1 className="py-3 text-[20px] border-b-[1px] border-b-neutral-300 text-neutral-900 font-semi text-left">
            {dil === "TM" ? tm.Bahasy : dil === "RU" ? ru.Bahasy : en.Bahasy}
          </h1>
          <div className="flex justify-between">
            <input
              className="w-[45%] h-[50px] mt-2 outline-none p-2 rounded-[8px] border-[1px] border-neutral-300"
              type="text"
              placeholder="0 TMT"
              value={priceRange[0] + " TMT"}
            />
            <input
              className="w-[45%] h-[50px] mt-2 outline-none p-2 rounded-[8px] border-[1px] border-neutral-300"
              type="text"
              placeholder="0 TMT"
              value={priceRange[1] + " TMT"}
            />
          </div>
          <div className=" mt-4 w-full px-2">
            <Slider
              sx={{
                "& .MuiSlider-thumb": {
                  color: "#32BB78",
                },
                "& .MuiSlider-track": {
                  color: "#32BB78",
                },
                "& .MuiSlider-rail": {
                  color: "#E9EAEE",
                },
                "& .MuiSlider-active": {
                  color: "#32BB78",
                },
              }}
              className="z-10  text-green"
              min={0}
              max={1000}
              getAriaLabel={() => "Minimum distance"}
              defaultValue={priceRange}
              // value={priceRange}
              onChange={(e) => {
                setPriceRange(e.target.value);
              }}
              valueLabelDisplay="auto"
              getAriaValueText={(e) => console.log("value text", e)}
              disableSwap
            />
          </div>
        </div>
      </div>
      <div className="w-full md2:pl-8">
        <div className="w-full flex items-center">
          <p
            onClick={() => history.push({ pathname: "/rtn/home" })}
            className="cursor-pointer text-[16px] font-regular text-black-secondary mr-2"
          >
            {dil === "TM"
              ? tm["Baş sahypa"]
              : dil === "RU"
              ? ru["Baş sahypa"]
              : en["Baş sahypa"]}
          </p>
          <ArrowForwardIos className="!text-[16px]  font-regular text-black-secondary mr-2" />
          <p className="text-[16px] font-regular text-black-secondary mr-2">
            {dil === "TM"
              ? tm["Gözleg netijesi"]
              : dil === "RU"
              ? ru["Gözleg netijesi"]
              : en["Gözleg netijesi"]}
          </p>
        </div>

        <div className="w-full md2:mt-6 mt-4  md2:flex hidden justify-between  items-center">
          <p className="text-[32px] font-semi text-neutral-900 mr-2">
            {dil === "TM"
              ? tm["Gözleg netijesi"]
              : dil === "RU"
              ? ru["Gözleg netijesi"]
              : en["Gözleg netijesi"]}
          </p>
          <div className="w-[200px]">
            <FormControl size="small" fullWidth>
              <InputLabel
                style={{ color: "#32BB78" }}
                id="demo-simple-select-label"
